import React from "react";
import { AppBar, Toolbar, Typography, Button, Grid } from "@mui/material";
import { Link } from "react-router-dom";
import Skill from "./Skill";
import Resume from "./Resume";
import Project from "./Project";
import Contact from "./Contact";

const Header = () => {
  return (
    <AppBar position="fixed" color="transparent" elevation={0}>
      <Toolbar>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} sm={6} md={3} lg={2}>
            <Typography variant="h6" component={Link} to="/" sx={{ textDecoration: 'none', color: 'inherit' }}>
              My Portfolio
            </Typography>
          </Grid>
          <Grid item xs={12} sm={6} md={6} lg={8}>
            {/* Empty grid item for spacing, adjust as needed */}
          </Grid>
          <Grid item xs={6} sm={2} md={1} lg={1}>
            <Button component={Link} to={Project} color="inherit">
              Projects
            </Button>
          </Grid>
          <Grid item xs={6} sm={2} md={1} lg={1}>
            <Button component={Link} to={Resume} color="inherit">
              Resume
            </Button>
          </Grid>
          <Grid item xs={6} sm={2} md={1} lg={1}>
            <Button component={Link} to={Skill} color="inherit">
              Skills
            </Button>
          </Grid>
          <Grid item xs={6} sm={2} md={1} lg={1}>
            <Button component={Link} to={Contact} color="inherit">
              Contact
            </Button>
          </Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
